import React from "react";
import logo from "./logo.svg";
import "./App.scss";

function Test() {
    return <h2>Hello</h2>;
}

function App() {
    return (
        <div className="App">
            <header className="App-header"></header>
            <p>{Test()}</p>
        </div>
    );
}

export default App;
